    return(
        <div className = "Homebg">
        
        <img src={logo} className="App-logo" alt="logo" />
        <h1 style = "color:purple">
          My Name is Bryan De Los Santos!
        </h1>
         
         <img src = {anime} className = "anime-tion" />
        

        </div>
        );
}

export default Home
